webpackJsonp([0xd4b92497eae8],{432:function(e,t){e.exports={data:{markdownRemark:{html:'<p>You can download reports as .CSV files to enable you to quickly generate a spreadsheet of selected reports with key details. The .CSV files don\'t include the comments. The downloaded file provides the:</p>\n<ul>\n<li>Report ID</li>\n<li>Title</li>\n<li>Severity rating</li>\n<li>Severity score</li>\n<li>State</li>\n<li>Substate</li>\n<li>Weakness</li>\n<li>Time the report was reported</li>\n<li>Time of first response</li>\n<li>Time of triage time</li>\n<li>Time the report was closed</li>\n<li>Time the hacker was awarded with the award</li>\n<li>Security member assigned to the report</li>\n<li>Hacker that submitted the report</li>\n<li>Bounty </li>\n<li>Bonus</li>\n<li>Whether the report is public or private</li>\n<li>Reference</li>\n<li>Reference URL</li>\n<li>Structured scope</li>\n</ul>\n<p>To export reports as a .CSV file:</p>\n<ol>\n<li>Select the check box of the reports you\'d like to export in your inbox. You can select as many reports as you\'d like. </li>\n<li>Click the <strong>Download as CSV</strong> link that appears to download the selected reports. </li>\n</ol>\n<p><img src="https://github.com/Hacker0x01/docs.hackerone.com/blob/master/docs/programs/images/export-reports.png?raw=true" alt="export-reports"></p>',frontmatter:{path:"/programs/export-reports",title:"Export Reports"}}},pathContext:{}}}});
